import Stars from "react-stars-display";

import "./Vote.scss";

const Vote = (props) => {
  const { header, note, color } = props;
  return (
    <>
      {header && <div className="vote-label">{header}</div>}
      <Stars
        stars={note}
        size={18} //optional
        spacing={2} //optional
        fill={color}
      />
    </>
  );
};

export default Vote;
